import React from 'react'
import { Box, FormControl, InputLabel } from '@material-ui/core'
import { withStyles } from '@material-ui/core/styles';
import PropTypes from 'prop-types';
import Text from '../text';
import Select from '../select'
import DatePicker from '../datePicker'
import TimePicker from '../timePicker'
import TextField from '@material-ui/core/TextField';

const styles = {
    root : {
        width :350,
        height : 400,
        backgroundColor : "rgba(238,238,238,0.8)",
        borderRadius : 10,
        padding : 20,
        paddingLeft : 20,
        paddingRight : 20
    },
    margin : {
        width : "100%"
    }
}

const Bookings = ({ classes, servicesPlaceholder }) => {

    return <Box className={classes.root}>
        <Box>
            <Text variant="h6" fWeight={600} ffamily="Poppins">Select Our Services</Text>
        </Box>
        <Box>
            <Select
                placeholder="Select Category"
            />  
            <Select
                placeholder="Select Services"
            />    
            <DatePicker />  
            <TimePicker />
            <TextField
                id="outlined-multiline-static"
                label="Multiline"
                multiline
                rows={4}
                defaultValue="Descri"
                variant="outlined"
            />
        </Box>
    </Box>
}

Bookings.propTypes = {
    servicesPlaceholder : PropTypes.string,
    // eslint-disable-next-line react/forb,id-prop-types
    classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(Bookings)
